import React from 'react';
import {BrowserRouter, Route, Switch} from 'react-router-dom';  

function Navigation(){
    return(
        <BrowserRouter>
        <div className="container">
            <Switch>
            <Route path='/' component={MainCourse} exact /> 
               <Route path='/ComboOffers' component={ComboOffer} /> 
               <Route path='/Watermelon' component={Watermelon} /> 
               <Route path='/Brownies' component={Brownies} /> 

            </Switch>



        </div>
        
        </BrowserRouter>
    )
}

export default Navigation
